}
const NewForm = (callback) => {
	const [text,setText]=useState("")
	return (
		<form>
			<NewInput
				type="text"
				placeholder="Type text"
				onChange={(e)=>{setText(e.target.value)}}
			/>
			<NewButton 
				onClick={(e)=>{
					e.preventDefault()
					callback(text)
				}}
			>Add text</NewButton>
		</form>
	);
}

export default NewForm;
